import React from 'react';
import styles from './Book6Anim.module.css';

const Book6 = () => {
    return (
        <div id="card">
            <div class={styles.container}>
                <div class={styles.door6}></div>
            </div>
            <p>Vacation</p>
        </div>
    );
};

export default Book6;
